    // dropdown header
    jQuery('.dropdown.notification .dropdown-menu .list').mCustomScrollbar();
    jQuery('.navbar-default .navbar-nav.navbar-right > li.dropdown .dropdown-menu').on('click',function(){
        event.stopPropagation();
    });

    // slider banner - homepage
    var time = 7; // time in seconds

    var jQueryprogressBar,
        jQuerybar,
        jQueryelem,
        isPause,
        tick,
        percentTime;

    //Init the carousel
    jQuery("#owl-banner").owlCarousel({
        slideSpeed : 500,
        paginationSpeed : 500,
        singleItem : true,
        afterInit : progressBar,
        afterMove : moved,
        startDragging : pauseOnDragging
    });

    //Init progressBar where elem is jQuery("#owl-demo")
    function progressBar(elem){
        jQueryelem = elem;
        //build progress bar elements
        buildProgressBar();
        //start counting
        start();
    }

    //create div#progressBar and div#bar then prepend to jQuery("#owl-demo")
    function buildProgressBar(){
        jQueryprogressBar = jQuery("<div>",{
            id:"progressBar"
        });
        jQuerybar = jQuery("<div>",{
            id:"bar"
        });
        jQueryprogressBar.append(jQuerybar).prependTo(jQueryelem);
    }

    function start() {
        //reset timer
        percentTime = 0;
        isPause = false;
        //run interval every 0.01 second
        tick = setInterval(interval, 10);
    };

    function interval() {
        if(isPause === false){
            percentTime += 1 / time;
            jQuerybar.css({
                width: percentTime+"%"
            });
            //if percentTime is equal or greater than 100
            if(percentTime >= 100){
                //slide to next item
                jQueryelem.trigger('owl.next')
            }
        }
    }

    //pause while dragging
    function pauseOnDragging(){
        isPause = true;
    }

    //moved callback
    function moved(){
        //clear interval
        clearTimeout(tick);
        //start again
        start();
    }
 
