// Hàm resize ảnh trước khi upload
// callback hàm xử lý sau khi resize
function resizeImage (file, size, callback) {
    var fileTracker = new FileReader;
    fileTracker.onload = function() {
        var image = new Image();
        image.onload = function(){
            var canvas = document.createElement("canvas");
            /*
            if(image.height > size) {
                image.width *= size / image.height;
                image.height = size;
            }
            */
            if(image.width > size) {
                image.height *= size / image.width;
                image.width = size;
            }
            var ctx = canvas.getContext("2d");
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            canvas.width = image.width;
            canvas.height = image.height;
            ctx.drawImage(image, 0, 0, image.width, image.height);
            var dataUrl = canvas.toDataURL('image/JPEG');
            var resizedImage = dataURLToBlob(dataUrl);
            callback(canvas.toDataURL("image/JPEG"),resizedImage);
        };
        
        image.src = this.result;
    }
    fileTracker.readAsDataURL(file);
    fileTracker.onabort = function() {
        alert("Việc tải file đã bị huỷ.");
    }
    fileTracker.onerror = function() {
        alert("Đã có lỗi xảy ra trong quá trình đọc file.");
    }
}
function dataURLToBlob(dataURL) {
    var BASE64_MARKER = ';base64,';
    if (dataURL.indexOf(BASE64_MARKER) == -1) {
        var parts = dataURL.split(',');
        var contentType = parts[0].split(':')[1];
        var raw = parts[1];

        return new Blob([raw], {type: contentType});
    }

    var parts = dataURL.split(BASE64_MARKER);
    var contentType = parts[0].split(':')[1];
    var raw = window.atob(parts[1]);
    var rawLength = raw.length;

    var uInt8Array = new Uint8Array(rawLength);

    for (var i = 0; i < rawLength; ++i) {
        uInt8Array[i] = raw.charCodeAt(i);
    }
    
    return new Blob([uInt8Array], {type: contentType});
}


