/*@Summary: định dạng số, có dấu phẩy phân hàng nghìn và dấu chấm phân hàng thập phân
* Note: chuỗi số input nhập vào sẽ theo format Vietnam và US, nghĩa là dấu phẩy ',' dùng để
* phân hàng nghìn, và dấu chấm '.' để phân phần thập phân.
*@param nStr: chuỗi số input để định dạng
*@param nDeciamal: số chữ số phần thập phân, mạc định là 2
*@author: Tuan Nam Nguyen
*/
function blaFormatNumber(nStr,nDecimal=2) {
	//Step 0: check valid number
	var nNumber=nStr;
	nNumber=nNumber.replace(/,/g, '');
	
	//STep 1: round
	if(nDecimal>=0)
		nNumber=Math.round(nNumber*Math.pow(10,nDecimal))/Math.pow(10,nDecimal);
	
	//Step 2: format with comma and point
  nNumber += '';
  var x = nNumber.split('.');
  var x1 = x[0];//phan truoc thap phan
  var x2 = x.length > 1 ? x[1] : '';
  var rgx = /(\d+)(\d{3})/;
  while (rgx.test(x1)) {
      x1 = x1.replace(rgx, '$1' + ',' + '$2');
  }
	if(x2.length>0)
  	return x1 + '.' + x2;
	else
		return x1;
 }
